  age: 28,
  email: "john@example.com"
}, {
  columnWidths: "33.33%",
  name: "Jane",
  age: 32,
  email: "jane@example.com"
}, {
  columnWidths: "33.33%",
  name: "Bob",
  age: 45,
  email: "bob@example.com"
}];
export default {
  title: 'Component/Table',
  component: TrTable,
  tags: ['autodocs']
};
export const Basic = ({
  data,
  border
